export const REGISTER_USER = 'REGISTER_USER';
export const REGISTER_USER_SUCCESS = 'REGISTER_USER_SUCCESS';

export const registerUser = user => ({
  type: REGISTER_USER,
  user,
});

export const registerUserSuccess = () => ({
  type: REGISTER_USER_SUCCESS,
});
